import React from "react";

import classes from "./LoginNav.module.css";

const LoginNav = (props) => {
  return (
    <nav className={classes.nav}>
      <ul>
        <li>
          <a href="/">Login</a>
        </li>
        <li>
          <button>test</button>
        </li>
      </ul>
    </nav>
  );
};

export default LoginNav;
